import React from 'react'
import { Card, CardHeader, CardBody, Box, Grommet } from 'grommet';
import { Phone, User } from 'grommet-icons';

export default function ContactCard(props) {
    return (
        <Grommet>
            <Card height={'xsmall'} width={'medium'} background={'light-1'} justify='center'>
                <CardHeader pad="xxsmall"><Box direction='row' justify='center' align='center'><User />{props.name}</Box></CardHeader>
                <CardBody pad="xxsmall">
                    <Box flex direction='row' justify='center'>
                        <Box pad={'small'}>{props.phone}</Box>
                        <Box pad={'small'}>{props.email}</Box>
                    </Box>
                </CardBody>
            </Card >
        </Grommet>
    )
}
